import React from "react";

import backfon from "../../pictures/";

import "./styles.css";

const Footer = () => {
  return (
    <footer className="MainFooter">
      <section className="section">
      <div className="workproject">Дтпромный проект</div>
<div className="nameavtor"> Made by <br/> Евгений</div>
        <div className="image ">
          <img src={backfon} alt={backfon} />
        </div>
      </section>
    </footer>
  );
};

export default Footer;
